Working from a script by Colin Higgins, Hal Ashby tells the story of the
emotional and romantic bond between a death-obsessed young man from a
wealthy family and a devil-may-care, bohemian octogenarian.

Equal parts gallows humor and romantic innocence, Harold and Maude dissolves
the line between darkness and light along with the ones that separate people
by class, gender, and age, and it features indelible performances and a
remarkable soundtrack by Cat Stevens.

